import { Home } from "./views/Home";

function App() {
  return (
    <div className="App">
      <header>
        <Navbar />
      </header>
      <main>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/productos/:id" element={<ProductDetail />} />{" "}
          {/* Cambié 'anime' a 'producto' */}
        </Routes>
      </main>
    </div>
  );
}

export default App;
